 of the Web. In this presentation, we overviewed the basic set of technologies that can be used to annotate web pages so that they can be processed by data-aware search engines. In particular, we discussed the RDFa and microdata standards of the W3C designed for marking up data in HTML pages. We looked at the ways in which this information is currently used by search engines, including the latest schema.org collaboration between Bing, Google, Yahoo! and Yandex, which provides a basic set of vocabulary items understood by all four major search engines on the Web.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Dw2OhqvB0cE/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCGaXfuxFHE720MHJONQ4pgu4q_DQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Dw2OhqvB0cE/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB_QdCj5e2BraTERwds6ZjBaN6ZHw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Dw2OhqvB0cE/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCfcNv4jixlER7P3m6zZxQnXpRVOw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/Dw2OhqvB0cE/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAuGWLF6W1cGfuBjc_NGXpJZVFIHg","width":336,"height":188},{"url":"https://i.ytimg.com/vi/Dw2OhqvB0cE/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"313","author":"Компьютерные науки","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"playerConfig":{"audioConfig":{"loudnessDb":1.6199999,"perceptualLoudnessDb":-12.38,"enablePerFormatLoudness":true},"streamSelectionConfig":{"maxBitrate":"10100000"},"mediaCommonConfig":{"dynamicReadaheadConfig":{"maxReadAheadMediaTimeMs":120000,"minReadAheadMediaTimeMs":15000,"readAheadGrowthRateMs":1000},"mediaUstreamerRequestConfig":{"videoPlaybackUstreamerConfig":"Cr0ICpYHCAAlAACAPy0zM3M_NT0Klz9YAWg
